Replying to @realDonaldTrump The @GOP has been leveled to nothing but a bunch of thankless cowards who will use you until they secure their power, then hang you out to dry.

 @senatemajldr stop giving our Party a bad name, fight for President Trump. 

You would have LOST without him.

Replying to @realDonaldTrump Courage President Trump!
Dans un combat, il y a : 
- les complices de l'adversaire;
- les figurants;
- les profiteurs;
- les dignes du combat. Ils portent le combat dans leur ame. Ils sont capables de sacrifice. Ils sont un modele. Ce sont Donald Trump, Laurent Gbagbo, etc.
